// 날짜 형식 검증 함수
function isValidDate(dateString, dateFormat) {
  var dateArr = dateString.split('-');
  var year = parseInt(dateArr[0], 10);
  var month = parseInt(dateArr[1], 10) - 1;
  var day = parseInt(dateArr[2], 10);

  var date = new Date(year, month, day);

  // Date 객체를 사용하여 날짜가 유효한지 확인
  return date.getFullYear() === year && date.getMonth() === month && date.getDate() === day;
}

function dateTimeToMilliseconds(dateTimeString) {
  var dateTime = new Date(dateTimeString);
  return dateTime.getTime().toString();
}

